        this.props.passRefUpward(this.refs);
    }
    getValue () {
        return this.state.food;
    }
    render() {
        return (
            <div className="menuitems">
                <h2>Menu Items</h2>
                <select id="food list" ref="menu"size="5"></select>
            </div>
        );
    }
}

export default MenuItems;
